import React, { FC } from 'react'
import API_SERVICES from '../../services/api_services'
import "./Home.css"

const Home : FC = () => {
    const getSchedule = async() => {
        let {data} = await API_SERVICES.getScheduleAll()
        if(data) {
            console.log(data,"this is api response")
        }
    }
  return (
    <div>Home</div>
  )
}

export default Home
